御朱印帳：サイズ：約12×18cm<br>
ジャバラ式：48P<br>
本体表地：正絹100％<br>
化粧箱入：箱サイズ：約13.5×19.5×2cm<br>
<br>
<br>
日本製<br>
<br>
表・裏、どちらからでもご使用頂けます。<br>
<br>
<br>
【西陣織とは】<br>
京都の「西陣」において製縫される織物の総称です。<br>
多くの品種を少しずつ生産する方式を基とした先染の<br>
紋織物として平安朝以降、宮廷文化を中心に文化の<br>
担い手として発展してきました。<br>
その歴史ある西陣織を御朱印帳として、寺社にお参り<br>
されるかたのお供にご満足いただける逸品に仕上げ<br>
ました。<br>
「西陣織」は西陣織工業組合の登録商標です。<br><style type="text/css">
